'[<emoji document_id=5352792306208480366>🌎</emoji>] ꤎ ઞꤌωё𐌻 ઞ꤀ꤐખ꤇ ꤍꤙ꤀ꤍ꤀ꤒ ꤣꤍꤙ꤀𐌻𑀨उ꤀ꤐꤌઞꤣꤎ ተꤐ꤀ꤕ꤇ 𐌼ꤌተꤕрꤣ, ꤎ ተꤕꤙꤕр𑀨 ꤐꤕωꤌળ ꤕё उꤌ𐌼ꤕꤍተ꤀ ꤐખӄ𐌻ળપꤌተꤕ𐌻ꤎ, ꤣ 𑀋γꤎрળ 𑀋γꤕ𐌼 ꤙ꤀ ꤙꤣउმꤕ ተꤐ꤀ꤕ꤇ 𐌼ꤌተꤕрꤣ, ꤣ ꤍрꤌउγ 𐌟ꤕ ꤐӄ𐌻ળપꤌꤕተꤍꤎ ꤍꤐꤕተ ꤐ ӄ꤀𐌼ઞꤌተꤕ) [<emoji document_id=5352792306208480366>🌎</emoji>]',
