'[<emoji document_id=5352792306208480366>🌎</emoji>] ተꤐ꤀ꤎ 𐌼ꤌተ𑀨 ӄ꤀꤅მꤌ ꤍ꤀ꤍёተ 𐌼꤀꤇ પ𐌻ꤕઞ, ꤍрꤌउγ ઞꤌપꤣઞꤌꤕተ მꤌꤐꤣተꤍꤎ ꤙ꤀પꤕ𐌼γ, ꤀მઞꤌ𐌟მખ ꤕ꤇ ꤙрꤣω𐌻꤀ꤍ𑀨 उꤌωꤣꤐꤌተ𑀨 ꤅꤀𐌻꤀ꤐγ, ꤙ꤀ꤍ𐌻ꤕ ተ꤀꤅꤀ ӄꤌӄ ꤎ ꤍ𐌻γપꤌ꤇ઞ꤀ ꤙр꤀ꤒꤣ𐌻 ꤕ꤇ उꤌተખ𐌻꤀ӄ 𑀋γꤕ𐌼 ӄ꤀꤅მꤌ ꤀ઞꤌ 𐌼꤀꤇ પ𐌻ꤕઞ ꤍ꤀ꤍꤌ𐌻ꤌ ) [<emoji document_id=5352792306208480366>🌎</emoji>]',
