'[<emoji document_id=5352792306208480366>🌎</emoji>] ઞγ ꤙр꤀ꤍተ꤀ ꤎ ꤐપꤕрꤌ ઞꤌꤍꤍꤌ𐌻 ઞꤌ ꤙꤣउმγ ተꤐ꤀ꤕ꤇ 𐌼ꤌተꤕрꤣ ꤣ 𐌼ઞꤕ ӄꤌ𐌟ꤕተꤍꤎ પተ꤀ ꤒрꤌተꤣӄꤌ γ ተꤕꤒꤎ ઞꤕ ꤒγმꤕተ ꤣꤒ꤀ ꤎ ꤕ꤅꤀ उꤌተꤙꤣ𐌻?? [<emoji document_id=5352792306208480366>🌎</emoji>]',
