'[<emoji document_id=5352792306208480366>🌎</emoji>] ઞγ ꤌр꤀ꤍተ꤀ ꤙ꤀꤇𐌼ꤣ પተ꤀ ꤕꤍ𐌻ꤣ ተખ ꤍꤕ꤇પꤌꤍ ઞꤕ ꤀ተӄꤌ𐌟ꤕω𑀨ꤍꤎ ꤀ተ მ꤀उખ 𐌼꤀ꤕ꤅꤀ 𑀋γꤎ ꤐ ተꤐ꤀ꤕ꤇ р꤀ተ꤀ꤐ꤀꤇ ꤙ꤀𐌻꤀ꤍተꤣ ተ꤀ ꤎ ꤒγმγ ꤐખઞγ𐌟მꤕઞ γꤕꤒꤌተ𑀨 ꤍꤐ꤀ꤣ𐌼ꤣ ꤎ꤇ꤟꤌ𐌼ꤣ ꤙ꤀ ተꤐ꤀ꤕ𐌼γ მꤕተꤍӄ꤀𐌼γ ꤌઞγꤍγ? ) ꤣ ꤎ ꤒγმγ ꤒꤣተ𑀨 ꤙ꤀ ઞꤕ𐌼γ ꤙ꤀ӄꤌ ꤀ઞ ઞꤕ ꤙꤕрꤕꤍተꤌઞꤕተ ꤐ꤀ઞꤎተ𑀨 рખꤒ꤀꤇?) [<emoji document_id=5352792306208480366>🌎</emoji>]',
